import Card from './Card'
import Ribbon from './top-ribbon';
import './home-styling.css'
import { useQuery } from '@tanstack/react-query';
import axios from 'axios'

function useProducts() {
    return useQuery(["posts"],   async () => {
      const { data } = await axios.get(
        "https://obscure-refuge-62167.herokuapp.com/products"
      );
      return data;
    });
}

function Home(){
    const {data,status}=useProducts()

    if (status==='loading')
        return <h1>Please wait, fetching data</h1>

    //console.log(data)

    let cards=[];
    data.forEach((element) => {cards.push(<button className='card' key={element['id']}><Card data={element} /></button>)})
    return (
        <>
        <Ribbon/>
        <div className='cards-container'>
            {cards}
        </div>
        </>
    )
}
export default Home;
